    false,nt"url": null,nt"notes": "This project is part of the Washington
    State Intensively Monitored Watershed (IMW) Program. Using passive inductive transponder
    (PIT) tags and remote stationary readers, we have been monitoring juvenile coho
    and steelhead movement, growth, and survival in Deep Creek, East Twin River, and
    West Twin River since 2005. To date, more than 67,000 fish have been tagged in these
    three watersheds.nnPIT tagging and habitat data. Includes fish weight, length, location,
